INSERT INTO `sanpham` (`sp_id`, `sp_loai`, `sp_ten`, `sp_gia`, `sp_km`, `sp_soluong`, `sp_nsx`, `sp_avatar`, `sp_noidung`, `sp_tukhoa`) VALUES
(15, 'du-lich', 'Backpack Americano', 130, 50, 57, 'Mikkor', 'images/product_images/20170809_230025.jpg', 'Balo Usa Gear S17 DRLS Backpack Black là mẫu được người dùng ưa chuộng nhất bởi sự tiện lợi của chiếc balo mang lại. Được thiết kế khẳng định phong cách riêng, mạnh mẽ và chuyên nghiệp. Kết hợp giữa đường nét cơ bản cùng với sắc đen sang trọng, thanh lịch đã tạo nên chiếc balo hoàn hảo từ cái nhìn đầu tiên. \r\n\r\nChất lượng sản phẩm được ưu tiên hàng đầu với sự kĩ càng trong khâu chọn lọc chất liệu sản phẩm. Với chất liệu vải có tính kháng nước cao. \r\n\r\nBalo Usa Gear S17 có khả năng mang theo máy ảnh, ống kính, chân máy, phụ kiện. Ngoài ra còn có hỗ trợ túi trùm chống mưa cho balo. Với thiết kế đa chiều có khả năng giúp người dùng lấy máy ảnh phía trước và bên hông. \r\n\r\nCùng với kích thước 40 x 30 x 20 cm thì chiếc balo máy ảnh đa chức năng còn hỗ trợ kèm theo ngăn để laptop với khóa kéo dọc lên đến 15.6 inch hoặc Macbook 17 inch. Bổ sung thêm dây đai chân máy giữ cố ịnh. Có  thì chiếc balo có thể mang theo một máy ảnh cỡ lớn và một số ống kính rời.\r\n\r\nThiết kế quai đeo chắc chắn, được lót lớp đệm êm ái giúp người dùng không bị đau lưng và vai khi sử dụng.', 'Lens Case, Lowepro, máy ảnh'),
(16, 'du-lich', 'Moab Jam 24L Black', 950, 21, 99, 'Jack Wolfskin', 'images/product_images/20170811_115744.jpg', 'Balo du lịch Jack Wolfskin Moab Jam 24L Backpack M Black với màu đen nam tính, năng động và thiết kế cực kỳ tiện dụng sẽ là một lựa chọn mà bạn không nên bỏ qua. Được làm từ chất liệu vải cao cấp, bền đẹp, balo sẽ giúp bạn đựng được thật nhiều đồ trong các chuyến đi xa, khám phá những miền đất mới.\r\nChất liệu siêu bền\r\n- Chiếc balo Jack Wolfskin Moab Jam 24L Backpack M Black được gia công tỉ mỉ làm từ chất liệu chống mài mòn vải nailhead 420D và lớp vải lót nhẹ QUA RIP 300D nên có khả năng chống nước, chống bám bụi, chống mài mòn và bền bỉ với thời gian.\r\nKiểu dáng thời trang và tiện dụng cho các chuyến đi\r\n- Balo được thiết kế linh hoạt, nhỏ gọn đầy đủ các chức năng của một balo du lịch, phối hợp với hệ thống đai vai ACS treo. Đây là hệ thống treo sử dụng công nghệ thoáng khí có chức năng làm mát cho người sử dụng.\r\nThông số của sản phẩm \r\n \r\nNgăn đựng laptop 13\"\r\n \r\nKích thước: 46x30x17cm\r\n \r\nTrọng lượng: 890g\r\n \r\nThể tích: 24 lít ', 'Jack Wolfskin, Balo du lịch, Jack Wolfskin Moab Jam 24L Backpack M Black'),
(20, 'ga-ran', 'Jollie Chin - Limited Edition', 99, 50, 50, 'Mấy đứa', 'images/product_images/20170819_091152.jpg', 'Hãy đến với Jolliebee để được thưởng thức món gà tươi nóng giòn từ bạn Jollie-Chin\r\nJollie-Chin sẽ đáp ứng mọi yêu cầu về gà của bạn. Từ ấp trứng, đẻ trứng, nuôi gà lớn lên và cắt cổ gà, vặt lông gà, rồi chặt gà và ướp gà, ôi nói thôi mà thấy thèm thuồng quá rồi. Hihi.\r\nVậy đó, mua bạn Chin liền nha.', 'JollieChin, Như bán gà, ghê ghê'),
(21, 'ga-ran', 'Balo Gà Hồng Trợn Mắt', 550, 25, 39, 'Pinka', 'images/product_images/20170810_021232.jpg', 'Balo Gà Hồng Trợn Mắt chiều cao khoảng 23 cm, rộng 21 cm.\r\nBalo được thiết kế dành riêng cho phải nam, với gam màu hồng nam tính chủ đạo, Pinka là sự lựa chọn hoàn hảo cho giới tập gym. Với điểm nhấn đôi mắt gà trợn chống trộm, sản phẩm tạo cảm giác an toàn, an nhiên yên tâm cho người dùng.', 'Gà, Hồng, Trợn Mắt'),
(22, 'thu-cung', 'Balo Mint Thêu Hình Thú', 350, 10, 5, 'Yumimi', 'images/product_images/20170817_190103.jpg', '- Thiết kế mini nhỏ nhọn, xinh xắn\r\n- Chất liệu da mềm, nhẹ, đường may sắc sảo, khóa kéo tinh tế\r\n- Đứng form, ko nhão\r\n- Hình thêu căng đét\r\n- Quá ư phù hợp cho cô nàng dịu dàng mà vẫn cá tính\r\n', 'balomini, balo mint, balo thêu'),
(23, 'thu-cung', 'Balo Mini Chữ Vờ (Valungtung)', 400, 0, 10, 'Valungtung', 'images/product_images/20170817_190211.jpg', '- Logo chữ V (Tên viết tắt của NSX)\r\n-Thiết kế trơn sang trọng, tao nhã\r\n- Chất liệu siêu xịn, mềm mại mà cứng cáp\r\n- Đường may siêu nét, dây kéo bạc, kèm 2 móc khóa tua rua\r\n- Tuy mini mà không mini, không gian bên trong rộng bao thoải mái\r\n- Số lượng có hạn\r\n', 'Balo mini, Balo xanh mint, balo chữ V, balo valungtung'),
(24, 'thu-cung', 'Balo Mini Chữ Vờ (Valungtung)', 400, 0, 10, 'Valungtung', 'images/product_images/20170817_190242.jpg', '- Logo chữ V (Tên viết tắt của NSX)\r\n-Thiết kế trơn sang trọng, tao nhã\r\n- Chất liệu siêu xịn, mềm mại mà cứng cáp\r\n- Đường may siêu nét, dây kéo bạc, kèm 2 móc khóa tua rua\r\n- Tuy mini mà không mini, không gian bên trong rộng bao thoải mái\r\n- Số lượng có hạn\r\n Màu đỏ chứng tỏ bị điên - các nàng yêu thích màu đỏ nên đưa vào bộ sưu tập của mình nhé\r\n', 'Balo mini, Balo đỏ, balo chữ V, balo valungtung'),
(25, 'thu-cung', 'Balo Mini Thỏ Hồng Chấm Bibi', 430, 0, 10, 'PinkGirl', 'images/product_images/20170817_190425.jpg', '- Balo mini gam hồng pastel xinh xắn, sản phầm dành riêng cho các nàng bánh bèo\r\n- Chất liệu da ko thấm hút mồ hôi\r\n- Khóa kéo siêu trơn trợt, không gỉ, không hao mòn\r\n- Sản phẩm từ NSX cuồng màu hồng ', 'balo mini, balo pink, balo hồng patel, balo tai thỏ'),
(26, 'thu-cung', 'Balo Mini Mèo Trợn Mắt Trắng', 430, 0, 10, 'PinkGirl', 'images/product_images/20170817_190450.jpg', '- Balo mini gam hồng pastel xinh xắn, sản phầm dành riêng cho các nàng bánh bèo \r\n- Chất liệu da ko thấm hút mồ hôi \r\n- Khóa kéo siêu trơn trợt, không gỉ, không hao mòn\r\n- Thiết kế hình mặt mèo vô cùng dễ thương \r\n- Sản phẩm từ NSX cuồng màu hồng', 'balo mini, balo pink, balo hồng patel, balo mèo'),
(27, 'thu-cung', 'Balo Kim Sa King Chói Lóa', 500, 5, 5, 'KiSaKi', 'images/product_images/20170817_190358.jpg', '- Thiết kế nhỏ gọn\r\n- Đính cườm thủ công sắc sảo, tỉ mỉ, đập vào mắt người xung quanh, thích hợp cho các bạn thích gây sự chú ý\r\n- Gam hồng tinh tế\r\n- Số lượng siêu có hạn\r\n ', 'balo mini, balo kimsa, '),
(28, 'thu-cung', 'Balo Mini óng ánh 7 Màu', 450, 0, 5, 'MiuMiu', 'images/product_images/20170817_190825.jpg', '- Thiết kế nhỏ gọn, vừa vắn\r\n- Da nhựa trơn long lanh óng ánh, nhìn xuyên thấu được bên trong\r\n- Độc đáo và lạ mắt\r\n- Trông vô cùng dễ thương', 'balo mini, balo trong suốt, balo xuyên thấu'),
(29, 'thu-cung', 'Balo Mini Mặt Cười TrongVeoVắt', 400, 5, 5, 'SmileIcon', 'images/product_images/20170817_190509.jpg', '- Form mini nhỏ gọn\r\n- Gam vàng hot trend 2017\r\n- Chất liệu nhựa trong suốt nham nhám\r\n- Không thấm hút mồ hôi và các chất lỏng khác, không ngại mưa gió bão bùng\r\n- Hình in mặt cười hoa hướng dương căng đét\r\n- Hàng hiếm, số lượng siêu siêu có hạn', 'balo mini, balo vàng, balo trong suốt,'),
(30, 'thu-cung', 'Balo Trong Veo Vắt', 300, 0, 10, 'VeoVeo', 'images/product_images/20170817_190606.jpg', '- Kích thước vừa vặn, để vừa iphone plus, ipad\r\n- Nhựa trong veo dày dặn, ko rách, ko xước, ko nhàu nát, chống nước cực tốt\r\n- Viền hồng bao quanh balo tôn sự trong sáng của sản phẩm\r\n- Tránh để các vận dụng có giá trị trong balo như vòng vàng, tiền, điện thoại,.....', 'balo trong suốt, balo xuyên thấu, balo trong veo'),
(31, 'thu-cung', 'Balo Trong Veo Vắt', 300, 0, 10, 'VeoVeo', 'images/product_images/20170817_190846.jpeg', '- Kích thước vừa vặn, để vừa iphone plus, ipad \r\n- Nhựa trong veo dày dặn, ko rách, ko xước, ko nhàu nát, chống nước cực tốt \r\n- Viền đen bao quanh balo vô cùng cá tính năng động \r\n- Tránh để các vận dụng có giá trị trong balo như vòng vàng, tiền, điện thoại,.....', 'balo trong suốt, balo xuyên thấu, balo trong veo'),
(32, 'may-anh', 'Lens Case 11 X 26cm', 150, 10, 5, 'Lowepro', 'images/product_images/20170809_225949.jpg', 'Lens Case 11 x 26cm\r\nLens Case 11 x 26cm của Lowepro được đặt tên theo kích thước ống kính phù hợp. Ví dụ: trường hợp ống kính này phù hợp với ống kính có đường kính lên đến 11 cm (4,3 \") và bằng 26 cm (10,2\") chiều cao.\r\nLens Case 11 x 26cm được công nhận trên toàn thế giới vì độ tin cậy và độ bền. Được cấu tạo từ nylon và các hợp chất khác mang lại cho bạn một buổi chụp hình đầy thú vị với khả năng chịu thời tiết khắc nghiệt, thất thường. Với thiết kế khóa kéo kép chắc chắn giúp bạn có thể dễ dàng lấy hoặc cất giữ ống kính một cách dễ dàng và thuận tiện nhất. Lowepro thậm chí còn nghĩ đến việc thiết kế một ngăn chứa lưới thuận tiện để bạn có thể lưu trữ nắp ống kính một cách an toàn.\r\nNgoài ra, Lens Case 11 x 26cm còn được đi kèm với một dây đeo vai điều chỉnh được. Bạn có thể tháo rời cùng với một dây buộc nén tiện dụng mà bạn có thể đính kèm vào một ba lô hoặc túi vai khác. Điều này giúp bạn rất nhiều trong việc cất giữ cả máy ảnh lẫn ống kính khi mang theo ra bên ngoài. Vì vậy, bạn an tâm khi bạn ra ngoài thực tế cùng với Lens Case 11 x 26cm.\r\nCác tính năng của Lens Case 11 x 26cm\r\nCung cấp bảo vệ tuyệt vời cho ống kính của bạn\r\nBảo vệ chống ăn mòn cho kính và khung nhám mỏng\r\nBảo vệ ống kính khỏi bụi và độ ẩm\r\nLấy và cất giữ ống kính thuận tiện, dễ dàng\r\nCó ngăn lưới giữ nắp ống kính bên trong Lens Case\r\nNhẹ và chắc chắn', 'Lens Case, Lowepro, máy ảnh'),
(33, 'may-anh', 'Balo  Pro Runner BP 350 AW II', 250, 5, 30, 'Lowepro', 'images/product_images/20170809_225934.jpg', 'Mô tả tóm tắt\r\n\r\n- Giữ được DSLR, 5-6 ống kính & phụ kiện\r\n- Che đậy cho máy tính xách tay 13 inch, máy tính bảng, Wacom\r\n- Đệm được gắn chặt trong các ngăn nội thất\r\n- Dây nịt vai, dây nối, vành đai eo\r\n- Mặt sau có lót tấm lót\r\n- Chịu được dưới thời tiết khắc nghiệt', 'Lowepro,  Pro Runner, máy ảnh'),
(34, 'may-anh', 'Túi Crumpler Cupcake 7500', 100, 1, 2, 'Crumpler', 'images/product_images/20170809_225905.jpg', '+ Đựng được 1 body 2 lens lớn 1lens nhỏ phụ kiện\r\n+ Kích thước: 32 x 20 x 10\r\n+ Trọng lượng : 200g\r\n+ Chất liệu vải 1000d Chicken Tex Supreme, mềm mại, bảo vệ bên trong với lớp lót Ripstop không thấm nước\r\n+ Dây đeo vai điều chỉnh với bọc vai có thể tháo rời\r\n+ Khóa dán và khóa nhựa kết hợp tạo nên 1 sự chắn chắn vô cùng\r\n+ Bên cạnh thiết kế tinh xảo thì sản phẩm còn có nhiều màu sắc đa dạng, trẻ trung...', 'Crumpler Cupcake, Crumpler, máy ảnh'),
(35, 'may-anh', 'Túi Máy ảnh Vanguard Heralder', 230, 20, 2, 'Vanguard', 'images/product_images/20170809_225812.jpg', '- Sức chứa: 1 máy DSLR với ống zoom cỡ vừa và các phụ kiện\r\n- Thiết kế đơn giản, gọn\r\n- Chất liệu nylon chống thấm\r\n- Dây đeo chắc chắn\r\n- Có áo mưa bên ngoài', 'Vanguard, Vanguard Heralder, máy ảnh'),
(36, 'may-anh', 'Balo Crumpler Jackpack', 450, 15, 10, 'Crumpler', 'images/product_images/20170809_225750.jpg', '- Chất liệu vải bạt dày, chịu nước, thiết kế độc đáo\r\n- Chống sốc từng ngăn do đó giảm sốc và va chạm và chống xước cho Máy\r\n- Có ngăn chia camera, ngăn laptop riêng,vừa laptop upto 15\"\r\n- Để được 1 body, 4-5 ống kính cùng các phụ kiện khác\r\n- Ba lô đựng máy ảnh, laptop, ống kính\r\n- Màu :đen,xanh,đỏ,tím', 'Crumpler Jackpack, Crumpler, máy ảnh'),
(37, 'may-anh', 'Balo Photo Hatchback BP', 365, 5, 5, 'Lowepro', 'images/product_images/20170809_225732.jpg', '- Ba lô Photo Hatchback BP 250 AW II phù hợp với ống kính DSLR.\r\n- Với ống kính gắn kèm (như 18-105mm).\r\n- 2 ống kính bổ sung, camera hành động.\r\n- Phụ kiện và vật dụng cá nhân.\r\n- Giữ máy tính bảng 10 inch ngay trong tay trong túi đựng chuyên dụng này.\r\n- Viền đệm thoải mái\r\n- Đai thắt lưng có thể điều chỉnh', 'Lowepro, Hatchback, máy ảnh'),
(38, 'may-anh', 'Balo Photo Hatchback BP 250 ', 420, 20, 2, 'Lowepro', 'images/product_images/20170809_225646.jpg', '- Ba lô Photo Hatchback BP 250 AW II phù hợp với ống kính DSLR.\r\n- Với ống kính gắn kèm (như 18-105mm).\r\n- 2 ống kính bổ sung, camera hành động.\r\n- Phụ kiện và vật dụng cá nhân.\r\n- Giữ máy tính bảng 10 inch ngay trong tay trong túi đựng chuyên dụng này.\r\n- Viền đệm thoải mái\r\n- Đai thắt lưng có thể điều chỉnh', 'Lowepro,Máy ảnh, chống nước'),
(39, 'may-anh', ' Vanguard Uprise 28 II Vanguar', 280, 10, 7, 'Vanguard', 'images/product_images/20170809_225627.jpg', '- Sức chứa: 1 body máy ảnh DSLR với 3-4 ống kính và phụ kiện\r\n- Có ngăn riêng cho máy tính bảng cỡ 11 inch\r\n- Có lớp lót đệm dày êm ở ngăn máy ảnh, lens\r\n- Điều chỉnh dây đeo dễ dàng\r\n- Chất liệu bền chắc\r\n- Thiết kế thời trang', 'Vanguard, chống nước, máy ảnh'),
(40, 'may-anh', 'Lowerpro Transit Sling 150 AW', 420, 30, 8, 'Lowepro', 'images/product_images/20170809_225545.jpg', '- Sức chứa lớn: 1 body, 2 lens, 1 flash, phụ kiện và máy tính bảng\r\n- Bao lô được chia ngăn cụ thể để phù hợp với mỗi loại thiết bị\r\n- Có các túi bên hông, thuận tiện cất giữ các phụ kiện mà bạn thường xuyên cần lấy ra, cất vào\r\n- Có ngăn riêng biệt cho laptop/máy tính bảng ích thước khoảng\r\n- Dây đeo chéo cân bằng được trọng lượng\r\n- Có gắn được chân máy nhỏ gọn một bên hông\r\n- Hệ thống đóng khóa bằng dây kéo êm ái\r\n- Chất liệu vải cao cấp, chống thấm', 'Lowepro,Máy ảnh, chống nước'),
(41, 'may-anh', 'Peak Design Everyday Messenger', 260, 15, 5, 'Peak Design', 'images/product_images/20170809_225518.jpg', 'Chứa: 1 laptop 15.6 inch, 3 ống kính, máy DSLR và 1 số phụ kiện khác\r\nHệ thống đóng mở tiên tiến\r\nThiết kế gọn gàng, hiện đại', 'Peak Design , Máy ảnh, chống nước'),
(42, 'ga-ran', 'Balo Siêu Nhân Trứng Gà Đỏ ', 480, 15, 39, 'Gaored', 'images/product_images/20170810_010305.jpg', 'Balo hình gà con hình dáng ngộ nghĩnh, màu sắc tươi sáng, với ngăn đựng đồ rộng rãi để đồ dùng vật dụng của bé ,sẽ là người bạn đồng hành đáng yêu cùng bé yêu đến trường.\r\nBa lô gà con có chất liệu cao cấp: phía trước là nhựa mềm ABS cao cấp, phía sau là vải sợi, giúp balo giữ được phom dáng cho balo của bé đồng thời có khối lượng nhẹ, quai đeo bản rộng êm ái, có thể thay đổi độ dài phù hợp cho bé yêu đeo đi học.\r\nCấu trúc balo hình trứng gọn gàng, in hình gà con đáng yêu với những chi tiết nhỏ đính kèm, chắc chắn balo  sẽ khiến bé mầm non, tiểu học yêu thích. Kích thước balo 12 inch nhỏ gọn, phù hợp với vóc dáng trẻ 3, 4, 5 đến 6 tuổi.', 'Siêu Nhân, Gà, Đỏ'),
(43, 'ga-ran', 'Balo(OrNot) Gà Con Đi Chợ  ', 350, 0, 25, 'SuperMarket', 'images/product_images/20170810_011059.jpg', 'Sợ gọi là balo, sợ không gọi là balo, muốn gọi là balo, muốn không gọi là balo, điều buồn nhất là, không phải balo mà làm như là balo.\r\nBalo Gà Con Đi Chợ có thể thay thế giỏ đi chợ, là một phương án bảo vệ môi trường và góp phần xây dựng khu phố văn hóa văn minh.\r\nBalo phù hợp với mọi lứa tuổi từ trẻ đến già đến sắp die, mọi giới tính từ trai gái đến bê đê.\r\nSố lượng có hạn!!', 'Gà, Đi Chợ,Balo(OrNot)'),
(44, 'ga-ran', 'Balo Gà Nhà Nuôi Hàng Real', 550, 10, 25, 'Realchick', 'images/product_images/20170810_011909.jpg', 'Với slogan \"gà nhà nuôi thật như nhà nuôi\" Realchick đã cho ra đời cái dòng sản phẩm con gà real nhằm mang đến sự chân thật cho người dùng khi sử dụng.\r\nThích hợp cho dân công sở, dân nghiện gà level cao, dân đá gà lậu, dân rẫy, vân vân.. sản phẩm của realchick đã đáp ứng được sự mong mỏi đối với việc biến balo và gà hòa làm 1, sản phẩm mang đến cảm giác khoan khoái, đạt đến sự khoái lạc khi sử dụng', 'Gà, Nhà Nuôi, Real'),
(45, 'ga-ran', 'Balo Con Gà Mặt Đơ Ahihi', 450, 25, 37, 'Ddowface', 'images/product_images/20170810_013238.jpg', 'Không còn nghi ngờ gì nữa, dòng sản phẩm Con gà mặt đơ, một thiết kế độc nhãn của Ddowface là sản phẩm dành riêng cho giới mặt đơ không cảm xúc.\r\nBạn bị thất tình? Bồ cấm xừng? bị rớt môn? phát hiên ra giới tính thật của bản thân? Đã có Con Gà Đơ giúp bạn đối diện với sự thật một cách tuy đơ mà chất nhất, đơ nhưng vẫn sống tốt, đơ nhưng vần mỉm cười gượng.\r\nSản phẩm chống chỉ thị với người có muối.', 'Con Gà, Mặt Đơ, Ahihi'),
(46, 'ga-ran', 'Balo Gà Giòn Vui Vẻ', 300, 10, 20, 'Tiemga.com', 'images/product_images/20170810_014832.jpg', 'Mang đậm tính giáo dục mạnh mẽ, đầy khả ái và ngây ngất lòng người, Balo Gà Giòn Vui Vẻ, lấy cảm hứng từ nguồn hay còn gọi là lấy nguồn cảm hứng từ món gà rán quen thuộc của giới trẻ, tạo cảm giác tươi vui khi vừa đeo balo vừa như đang được ăn gà, giúp việc học tập và làm việc trở nên tươi tắn và từ đó ánh mắt hồn nhiên đến lạ.', 'Gà, Giòn, Vui Vẻ'),
(47, 'ga-ran', 'Balo Con Này Không Phải Gà', 300, 0, 10, 'Chipchip', 'images/product_images/20170810_015756.jpg', 'Lấy nguồn cảm hứng từ câu hát mông lung như một trò đùa của sếp Tùng, Chipchip đã cho ra đời cái dòng sản phẩm balo gà nhưng không phải gà, gà mà creepy vch ._.\r\nSản phẩm phù hợp cho những người thích cảm giác mạnh chẳng hạn như người có bệnh tim mạch, sỏi thận, vân vân..', 'Con, Gà, Không Phải'),
(48, 'ga-ran', 'Balo Đàn Gà Mổ Lấy Mổ Để', 820, 10, 34, 'Motherchicher', 'images/product_images/20170810_020606.jpg', 'Với thiết kế cầu kì họa tiếc rối mắt gồm 3 con gà được in nhỏ xíu trong góc trên nền xám, Balo Đàn Gà đã chiếm trọn niệm yêu mến của vô vàn bạn nhỏ tuổi dậy thì.\r\nChất vải lưới thấm nước khi trời mưa, đường chỉ được may máy lỏng lỏng, màu sắc trang nhã dễ bạc màu, Motherchiker vô cùng tự hào khi cho ra đời sản phẩm này. ', 'Đàn Gà, Mổ, Balo'),
(49, 'ga-ran', 'Balo Gà Trắng Thế Giới Vuông', 250, 20, 44, 'Chickscraft', 'images/product_images/20170810_021938.jpg', 'Là sự lựa chọn hàng đầu của hàng ngàn game thủ minecraft, Balo Gà Trắng Thế Giới Vuông được fashionista hàng đầu thế giới Pukachi thiết kế suốt 5 tuần liền không ăn không ngủ không đi vệ sinh.\r\nVới chất liệu da cá sấu sơn màu xanh, dáng balo ngon nghẻ hình chữ nhật, Chickcarft đã không làm thất vọng người hâm mộ.', 'Gà, Trắng, Vuông'),
(50, 'du-lich', 'Moab Jam 24L Backpack M Blue', 499, 25, 47, 'Jack Wolfskin', 'images/product_images/20170811_100043.jpg', 'Mùa hè là mùa du lịch, bạn đã tìm được cho mình một chiếc balo thích hợp cho chuyến đi của mình chưa? Balo du lịch Jack Wolfskin Moab Jam 24L Backpack M blue với sắc xanh năng động và thiết kế cực kỳ tiện dụng sẽ là một lựa chọn mà bạn không nên bỏ qua.\r\nĐặc điểm nổi bật của sản phẩm\r\n \r\nChất liệu siêu bền\r\n \r\n- Chiếc balo Jack Wolfskin Moab Jam 24L Backpack M Blue được gia công tỉ mỉ làm từ chất liệu chống mài mòn vải nailhead 420D và lớp vải lót nhẹ QUA RIP 300D nên có khả năng chống nước, chống bám bụi, chống mài mòn và bền bỉ với thời gian.\r\n- Đặc biệt, balo có kèm theo áo mưa cho balo giúp bạn không phải lo lắng trong bất cứ thời tiết nào. Những chiếc balo hàng hiệu hoàn hảo thật tiện lợi và đa năng bạn có thể dễ dàng phối chúng với nhiều bộ trang phục khách nhau trông bạn thật năng động và cá tính.', 'Moab Jam 24L, Backpack M Blue, Jack Wolfskin'),
(51, 'du-lich', 'Strike 18 Backpack S Matrix 3', 699, 0, 29, 'Lowe Alpine', 'images/product_images/20170811_100255.jpg', 'Ngày nay, balo ngày càng trở thành món đồ phụ kiện không thể thiếu được của giới trẻ, bởi sự tiện dụng cùng phong cách thời trang cá tính mà nó đem lại cho người sử dụng. Với thiết kế mới mẻ, khỏe khoắn và không kém phần nổi bật, balo Lowe Alpine Strike 8 Backpack S Matrix 3 sẽ mang lại cho bạn trải nghiệm ưng ý khi dùng.\r\nĐặc điểm nổi bật của sản phẩm\r\n\r\nHai ngăn tiện sử dụng\r\n\r\n- Balo Lowe Apline Strike 18 Blackpack S Matrix 3 có thiết kế chỉ với hai ngăn gồm 1 ngăn chính rộng rãi và 1 ngăn phụ nhỏ phía ngoài, nhưng cũng là đủ để cho bạn đựng được nhiều đồ dùng thiết yếu khi đi làm hay cho các chuyến đi xa vào dịp cuối tuần.\r\n\r\n- Với balo Lowe Apline Strike 18, bạn vừa có thể đeo trên vai ở phía sau lưng hay phía trước ngực, bên cạnh đó balo còn có thể xách tiện dụng, giúp bạn dễ dàng thay đổi tư thế mang balo và cảm thấy thoải mái trong hành trình.  \r\n\r\nTrọng lượng siêu nhẹ, dễ di chuyển\r\n\r\n- Sản phẩm cỡ S nhỏ gọn với trọng lượng 0.57kg siêu nhe, bạn có thể dùng để đựng đồ cho những chuyến du lịch, dã ngoại từ 2 đến 3 ngày. ', 'Lowe Alpine, Strike 18 Backpack, S Matrix 3'),
(52, 'du-lich', 'Mountaineer 36 M Orange', 599, 22, 25, 'Jack Wolfskin', 'images/product_images/20170811_100432.jpg', 'Jack Wolfskin Mountaineer 36 M Orange - Sự lựa chọn hoàn hảo để đi phượt\r\n\r\nLựa chọn balo đi phượt hay đi du lịch không đơn thuần chỉ là thời trang và êm ái như chiếc balo thông thường mà nó cần phải đảm bảo đầy đủ tính năng tiện ích để bạn có thể chứa được nhiều đồ dùng cần thiết. Lúc này, balo Jack Wolfskin chính là sự lựa chọn hoàn hảo dành cho bạn\r\nChiếc balo Jack Wolfskin Mountaineer 36 M Orange là một trong những sản phẩm đình đám của thương hiệu balo Jack Wofskin cho balo cỡ trung với kích thước vừa phải. Sản phẩm không chỉ đảm bảo về chất lượng và chức năng của một chiếc balo thương thường mà hệ thống đệm lưng làm cực khủng giúp bạn thoải mái di chuyển trên mọi chặng đường. Khi phải đi du lịch đặc biệt là leo núi thì một chiếc balo tốt hàng hiệu với quai đeo, khóa kéo, chất liệu vải đủ tốt sẽ là những tính năng cần phải quan tâm.\r\n\r\n Đặc điểm nổi bật của sản phẩm\r\n\r\n - Chất liệu siêu bền\r\n\r\nChiếc balo này được gia công tỉ mỉ làm từ chất liệu Oberstoff: 100% polyamide và Oberstoff: 100% Polyesternỉ nên có khả năng chống nước, chống bám bụi, chống mài mòn và bền bỉ với thời gian.\r\n\r\nĐặc biệt, balo có kèm theo áo mưa cho balo giúp bạn không phải lo lắng trong bất cứ thời tiết nào. Những chiếc balo hàng hiệu hoàn hảo thật tiện lợi và đa năng bạn có thể dễ dàng phối chúng với nhiều bộ trang phục khách nhau trông bạn thật năng động và cá tính.\r\n\r\nNếu là một anh chàng, cô nàng yêu thích sự thoải mái, năng động và thời trang thì đừng bỏ qua những thiết như thế này nhé!', 'Mountaineer 36 M Orange, Jack Wolfskin, BAALOO'),
(53, 'du-lich', 'Futura 32L Backpack M Black', 699, 30, 43, 'Deuter', 'images/product_images/20170811_100741.jpg', 'Ba lô hoàn hảo cho một chuyến đi dài thoải mái với đầy đủ các phụ kiện và quần áo của bạn. Aircomfort Hệ thống FlexLite của ba lô có xây dựng hai khung linh hoạt có khả năng lưu thông không khí ba mặt hiệu quả và rất nhẹ. \r\nThông tin chi tiết: \r\nAirMesh dây đeo vai có dây đai điều chỉnh tải \r\nTwin-frame cho hệ thống Flexlite Aircomfort 3D có khả năng thoáng khí mạnh mẽ.\r\nNgăn chính rộng rãi đóng mở với dây rút tiện lợi. \r\nNgăn phụ lớn phía dưới có khả năng đựng đồ dơ hoặc giày dép của bạn.\r\nĐai hông có khả năng giảm tải trọng lên vai của bạn.\r\nĐáy túi cung cấp túi áo mưa cho balo có khả năng chống lại mọi thời tiết từ bên ngoài.\r\nCác đai xung quanh giúp định hình balo. Giữ cho trọng lượng cân bằng.\r\nĐược làm từ chất liệu 600 Polyester với một lớp phủ PU dày, mạnh mẽ, nhẹ. \r\nMacro Lite 210 ', 'Deuter, Futura 32L Backpack M Black, Futura 32L Backpack M Black'),
(54, 'du-lich', ' Discovery 100 S Gre', 99, 10, 99, 'Benro', 'images/product_images/20170811_101024.jpg', 'Discovery là dòng túi máy ảnh thời thượng kết hợp hoàn hảo giữa tính năng chống nước và trọng lượng cực nhẹ. Sản phẩm được sản xuất từ chất liệu vải chống thấm, công nghệ ép nhiệt không đường may đảm bảo chống nước tuyệt đối cùng hệ thống khóa kéo YKK tăng thêm tính an toàn cho thiết bị bên trong. Với thiết kế mới mẻ độc đáo không kém phần thời thượng. Discovery sẽ là lựa chọn tuyệt vời cho mùa mưa năm nay cũng như những chuyến phượt xa của bạn.\r\nModel: Discovery 100.\r\nDiscovery có thể biến tấu thành 1 chiếc túi chuyên dụng vơi thiết kế ruột túi tháo rời tiện dụng.', 'Balo Benro,  Discovery 100 S Gre, Balo Benro,  Discovery 100 S Gre'),
(55, 'du-lich', 'Balo Benro Swift 100 S Blue', 65, 15, 56, 'Benro', 'images/product_images/20170811_101138.jpg', 'Với thiết kế cơ động cho phép bạn tháo rời các phụ kiện đi kèm để tạo thành một chiếc balo du lịch.\r\n\r\nĐược thu thập thông tin từ những khách hàng sử dụng , BENRO cho ra đời thiết kế Swift .\r\n\r\nNó được cung cấp gần như đầy đủ các tính năng cần thiết.\r\n\r\nTúi máy ảnh Benro Swift nặng 0.74kg và được làm bằng 1000D không thấm nước vật liệu nylon. Trọng lượng nhẹ, thiết kế kiểu dáng đẹp và phù hợp để chụp ảnh ngoài trời.\r\n\r\nTay cầm được cung cấp độn mút tạo cảm giác thoải mái khi sử dụng.\r\n\r\nTúi được trang bị dây kéo YKK, không thấm nước và bền.\r\n\r\nTay kéo được bao quanh bởi vòng nhôm màu đỏ cho các hoạt động và thời trang dễ dàng hơn. \r\n\r\nBên hông túi cung cấp dây khóa giữ chân máy.\r\n\r\nPhía sau cung cấp đệm khí lưới, Làm mát lưng. Ngăn chính máy ảnh cũng được đặt ở phía sau đảm bảo ăn toàn tuyệt đối cho các thiết bị của bạn.\r\n\r\nDây đai ngực và eo có thể tháo rời.\r\n\r\nBên hông túi cung cấp khả năng mang theo chai nước.\r\n\r\nTay cầm bên hông túi hỗ trợ bạn khi tháo balo khỏi vai.\r\n\r\nĐáy túi được sử dụng chất liệu chống thấm và chống lại tác động cửa bên ngoài.\r\n\r\nPhía trước cung cấp ngăn phụ kiện đi kèm, Cho phép bạn mang theo sổ sách , chìa khóa và các phụ kiện khác.\r\n\r\nNgăn chính cung cấp khoảng trống để quần áo , sách vở  , pin xạc....\r\n\r\nTúi rời đựng máy ảnh được bảo vệ bởi dây rút chống nước.\r\n\r\nKhông chỉ nhỏ gọn và thời trang, Swift cũng có thể giữ thiết bị đáp ứng nhu cầu. Nó có thể giữ 1 DSLR, 2 ống kính và 1 đèn flash. ( 5D2 của tôi, 24-70mm f/2.8L và 70-200mm f/2.8L ống kính. Máy ảnh và ống kính trong đó là ổn định và an toàn. \r\n\r\nKhi loại bỏ các máy ảnh và ống kính ngăn, không có tắc nghẽn giữa phần trên và kho thấp hơn. Nó có thể giữ nhiều công cụ.\r\n\r\nBao gồm mưa áo bảo vệ các gói từ nước, mưa, cát hay bụi. ', 'Balo Benro, Balo Benro Swift 100 S Blue, Balo Benro Swift 100 S Blue'),
(56, 'du-lich', 'Dip Tarp Backpack M Pink', 109, 30, 52, 'Superdry', 'images/product_images/20170811_101320.jpg', 'BALO THỜI TRANG SUPERDRY\r\n\r\nBalo Superdry Dip Tarp Backpack Pink là một trong các mẫu balo được ưa chuộng nhất của dòng Superdry. Được thiết kế với những đường nét phá cách nhưng vẫn thể hiện được sự trẻ trung, năng động mà chiếc balo này mang lại. Sự kết hợp hài hòa từ thiết kế cùng với sắc hồng đã tạo nên chiếc balo hoàn hảo và gây ấn tượng cho người dùng từ cái nhìn đầu tiên. \r\n\r\nChất lượng sản phẩm được ưu tiên hàng đầu với sự kĩ càng trong khâu chọn lọc chất liệu sản phẩm. Sử dụng chất liệu vải Tabolin kháng nước cực tốt cùng với công nghệ phun sơn hiện đại nhất và tính năng chống ánh sáng mặt trời cũng được hỗ trợ cho chiếc balo này. \r\n\r\nVới kích thước 44 x 30 x 18 cm thì chiếc balo được thiết kế với 2 ngăn chính cùng các ngăn phụ trợ. Ngăn chính phía sau có diện tích rộng rãi có thể vừa cho laptop lên đến 15.6 inch, có đệm chống sốc cực kì êm ái và ngăn chính phía trước có thể dùng để quần áo hoặc sách vở. \r\n\r\nChiếc balo gọn nhẹ chỉ với trọng lượng 0,6 kg nhưng có thể chứa được thể tích 24L.\r\n\r\nNgoài ra còn có ngăn cho máy nghe nhạc với đầu ra cho tai nghe hoàn hảo. Quai đeo được thiết kế thoáng khí, có khả năng lưu thông và làm mát lưng. ', 'Balo Superdry Dip Tarp Backpac, Dip Tarp Backpack M Pink, Superdry'),
(57, 'du-lich', 'The Irvin Backpack M Black', 150, 25, 52, 'Mikkor', 'images/product_images/20170906_173407.jpg', 'The Irvin Backpack là dòng balo laptop thể thao được thiết kế trên nền vải chính Supertex 1000D Nylon Kodura, PU 80mg chống nước tuyệt vời; vải lót P/210D tráng PU in logo thương hiệu nổi trên mặt vải; đáy túi với vải Tarpaulin chống nước và siêu bền.\r\n\r\nKích thước: 28 x 16 x 43 (cm)\r\n\r\nTrọng lượng: 0,8 (kg)\r\n\r\nVới một ngăn chính 18L;\r\n1 ngăn laptop vừa size máy max Mac 17\", PC 15.6\"\r\n1 ngăn Ipad\r\n1 ngăn lưới khoá kéo dưới nắm chính đựng phụ kiện như sạc máy, bóp ví...\r\n1 ngăn lưới khoá kéo trên bên ngoài nắp chính đựng bóp ví, chìa khoá, điện thoại.\r\n1 ngăn lưới hông dựng bình nước\r\n1 ngăn đựng phone, dắt viết\r\n\r\nThân túi được thiết kế đặc trưng phong cách thể thao, đệm foam dày êm trên nền lưới Airmesh thoáng nhiệt, quai xách sau bằng da êm ái. \r\n\r\n2 bên hông túi được thiết kế loop đai treo phụ kiện du lịch như Tripod, gậy selfie, karabiner, hay vòng dây dù khi dã ngoại.\r\n\r\nToàn bộ thân túi đệm foam giúp balo The Irvin Backpack chắc chắn và đứng form khi sử dụng.\r\n\r\nSản phẩm được bảo hành chính hãng 5 năm', 'The Irvin Backpack M Black, Balo Mikkor, Balo Mikkor');
